The '''White Tree''' can refer to any of these trees: 
* [[Telperion]], the White Tree of [[Valinor]], one of the [[Two Trees of Valinor]].
* [[Galathilion]], The White Tree of [[Tirion]].
* [[Celeborn (White Tree)|Celeborn]], the White Tree of [[Tol Eressëa]].
* [[Nimloth of Númenor|Nimloth]], the White Tree of [[Númenor]].
* '''The [[White Tree of Gondor]], four different seedlings.'''

* It can also refer to [[The White Tree Fund]], a charitable organisation. 
